import React, { Component } from "react";
import Card from "./Card";
import CardDeck from "react-bootstrap";

class DataDisplay extends Component {
  state = {};
  render() {
    return (
      <CardDeck>
        {this.props.data.map((data) => (
          <Card data={data} />
        ))}
      </CardDeck>
    );
  }
}

export default DataDisplay;
